INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Privacy policy','Privacy policy | Yarnstreet.com','','conditions, delivery, delay, shipment, pack','<h3 style=\"font-family:\'Open Sans\', sans-serif;line-height:1.1;color:#282828;margin:0px 0px 10px;font-size:20px;text-transform:capitalize;\"><span style=\"color:#000000;background-color:#ffffff;\">Privacy policy</span></h3>\n<div style=\"color:#333333;font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:14px;font-weight:400;\">\n<p style=\"margin:0px 0px 15px;\"><span style=\"color:#000000;background-color:#ffffff;\">We take the security and privacy of your personal data extremely seriously and we follow all General Data Protection Regulation (GDPR) rules, and our Data protection Policy contains details of how we handle that information.</span></p>\n<p style=\"margin:0px 0px 15px;\"><span style=\"color:#000000;background-color:#ffffff;\">FAQs</span></p>\n<p style=\"margin:0px 0px 15px;\"><span style=\"color:#000000;background-color:#ffffff;\"><strong>Does Yarnstreet collect personal data?</strong></span><br /><span style=\"color:#000000;background-color:#ffffff;\">Yes.</span><br /><span style=\"color:#000000;background-color:#ffffff;\">What personal data does Yarnstreet collect?</span><br /><span style=\"color:#000000;background-color:#ffffff;\">Primarily, we collect your name, address, email address and telephone number.</span></p>\n<p style=\"margin:0px 0px 15px;\"><span style=\"color:#000000;background-color:#ffffff;\"><strong>Why does Yarnstreet collect personal data?</strong></span><br /><span style=\"color:#000000;background-color:#ffffff;\">Quite simply, if we didnât, we wouldnât be able to provide our services to you. For example, we need your name and address so we know where to send your order and we need your email address and/or telephone number in order to contact you with your order confirmation, shipping confirmation, and to get in touch if there are any problems with your order.</span></