 in so that we can remember this fact. This prevents you from having to log in every single time you visit a new page. These cookies are typically removed or cleared when you log out to ensure that you can only access restricted features and areas when logged in.<br /><br /><br /><br />This site offers e-commerce or payment facilities and some cookies are essential to ensure that your order is remembered between pages so that we can process it properly.<br /><br />In order to provide you with a great experience on this site we provide the functionality to set your preferences for how this site runs when you use it. In order to remember your preferences we need to set cookies so that this information can be called whenever you interact with a page is affected by your preferences.<br /><br /><br /><br />Third Party Cookies<br /><br />In some special cases we also use cookies provided by trusted third parties. The following section details which third party cookies you might encounter through this site.<br /><br />This site uses Google Analytics which is one of the most widespread and trusted analytics solution on the web for helping us to understand how you use the site and ways that we can improve your experience. These cookies may track things such as how long you spend on the site and the pages that you visit so we can continue to produce engaging content.<br /><br />For more information on Google Analytics cookies, see the official Google Analytics page.<br /><br /><br /><br />More Information<br /><br />Hopefully that has clarified things for you and as was previously mentioned if there is something that you aren\'t sure whether you need or not it\'s usually safer to leave cookies enabled in case it does interact with one of the features you use on our site. However if you are still looking for more information then you can contact us through one of our preferred contact methods.<br /><br />Email: info@yarnstreet.com</p>\n</div>','cookies-policy'),(2,2,1,'Polityk